import React from 'react';
import Header from './Header'
import Footer from './Footer'
import Note from './Note';
import notes from './Notes';

const App = () => {
    return (
        <div>
            <Header/>
            {
                notes.map(items => {
                    return(
                    <Note 
                    id={items}
                    key={items.key}
                    title={items.title}
                    content={items.content}
                    />)
                })
            }
            <Footer/>

        </div>
    )
}

export default App;
